多分新しそうなマニュアルへのリンク https://gcc.gnu.org/onlinedocs/gcc/Using-Assembly-Language-with-C.html アセンブラが機械語と一対一だというのが妄言だと理解したら、 インラインアセンブラの移植性皆無で超絶便利な機能を理解する準備ができたといえる。 アセンブラが扱うのはレジスタだが、C では変数という抽象的な概念を操作している。 アセンブラを書くとなると C との間で変数の受け渡しが非常にしたくなるところだが、 インラインアセンブラの文法はこの受け渡しをきれいに行ってくれる。 また、レジスタ入出力の依存性をしっかり書けば、最適化の恩恵を受けることもできる (volatile で拒否することもできる)。 asm volatile ("template" : output : input : clobber); volatile これをつけないと入力レジスタから出力レジスタを生成するだけの命令列として 最適化の対象になるが、これをつけるとこの最適化を無効にする。 副作用のある命令を書く場合は必ず必要。 template アセンブラのテンプレート。 ここから特定の文字列を入出力レジスタ名に自動で置換してくれたりする。 output 出力オペランド指定。 input 入力オペランド指定。 clobber このアセンブラで破壊されるレジスタ。 "memory" を指定するとメモリの読み書きを行うことをコンパイラに通知する。 実質的にコンパイラに対するメモリバリアとなる (このアセンブラをまたいだメモリ読み書き命令の並べ替え抑止)。 プロセッサによる投機実行は防げない。 マニュアル中の例。 void do_print(uint32_t dwSomeValue)
{ uint32_t dwRes; for (uint32_t x=0; x < 5; x++) { // Assumes dwSomeValue is not zero. asm ("bsfl %1,%0" : "=r" (dwRes) : "r" (dwSomeValue) : "cc"); printf("%u: %u %u\n", x, dwSomeValue, dwRes); }
} bsfl は x86 の Bit Scan Forward 命令で、1が立っているビットの中で最下位のものの インデックスを返す命令らしい。 テンプレート文字列中の %0 や %1 は、続く入出力オペランド指定で渡された 値に該当する文字列に置換される。 ここでは C の引数やローカル変数をレジスタ指定で与えているため、 コンパイラの決めたレジスタ名に置換される。 出力オペランドを "=r" (dwRes) のように記述することで、C のローカル変数 dwRes に 対応するレジスタに値が書き込まれることをコンパイラに伝えることができる。 = は書き込みを示す。 r は値のタイプで、レジスタを示す。ここを変えれば即値を渡せたりもする、と思う。 入力オペランドも同様。 C 引数の dwSomeValue の値が入ったレジスタ名で %1 が置換される。 最後の "cc" は x86 のフラグレジスタが破壊されることを示す。 この入出力オペランド制約では、ループ中で5回呼び出す意味はないと判断され、 コンパイラによってループの外に出される可能性がある。 それを防ぎたいならば、asm volatile とする必要がある (volatile 変数と同じ)。 ただし volatile 変数と同じく、asm volatile をまたいで他の命令が移動される ことはあり得る (volatile 同士の順番は保存されたはず)。 以下のマニュアルの例では、浮動小数点丸めモードのコントロールレジスタの後に 演算が行われることを保証するために、sum への書き込み依存を追加している。 %0 は現れていないため実際には書き込まれないが、コンパイラは sum = x + y という sum への書き込みを上に移動することはできなくなる (sum の結果が変わってしまうように見えるため)。 asm volatile ("mtfsf 255,%1" : "=X" (sum) : "f" (fpenv));
sum = x + y; このように、文法が覚えづらいとか、資料が少なすぎるとか、互換性汎用性が皆無とか、 CPU 固有のオプションがいっぱいあるとかを我慢すれば、C コードとの間の値の受け渡しを かなりスムーズに実現できる。 素のアセンブリで関数を書くと、呼び出し規約を読みながら引数と返り値がどこに置かれるかで 苦労するし、そもそもインライン化して関数コールのオーバーヘッドを消したいという ケースも多いかもしれない。
